import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroBg from "../images/hero-bg.jpg";

const Partnership = () => {
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState("location");
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    goal: "",
  });

  const handleInputChange = (field, value) => {
    setSearchParams((prev) => ({
      ...prev,
      [field]: value,
    }));
  };

  const handleSearch = () => {
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen relative">
      {/* 半透明背景图 */}
      <div className="absolute inset-0">
        <img
          src={heroBg}
          alt="Background"
          className="w-full h-full object-cover"
        />
        <div className="absolute inset-0 bg-teal-600/30 backdrop-blur-sm"></div>
      </div>

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 text-white hover:text-teal-100 z-10"
      >
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 pt-32 px-4 sm:px-6 lg:px-8">
        <div className="max-w-5xl mx-auto text-center">
          <h1 className="text-5xl font-bold text-white mb-12">
            Let's Find Your Perfect Partner
          </h1>

          {/* 搜索区域 */}
          <div className="bg-white rounded-xl shadow-lg p-6 mt-8">
            {/* 标签栏 */}
            <div className="flex mb-6 border-b">
              <button
                className={`px-6 py-3 text-sm font-medium ${
                  activeTab === "location"
                    ? "text-teal-600 border-b-2 border-teal-600"
                    : "text-gray-500 hover:text-gray-700"
                }`}
                onClick={() => setActiveTab("location")}
              >
                Location
              </button>
              <button
                className={`px-6 py-3 text-sm font-medium ${
                  activeTab === "type"
                    ? "text-teal-600 border-b-2 border-teal-600"
                    : "text-gray-500 hover:text-gray-700"
                }`}
                onClick={() => setActiveTab("type")}
              >
                Organization Type
              </button>
              <button
                className={`px-6 py-3 text-sm font-medium ${
                  activeTab === "goal"
                    ? "text-teal-600 border-b-2 border-teal-600"
                    : "text-gray-500 hover:text-gray-700"
                }`}
                onClick={() => setActiveTab("goal")}
              >
                Partnership Goal
              </button>
            </div>

            {/* 搜索表单 */}
            <div className="grid grid-cols-12 gap-4 items-center">
              <div className="col-span-3">
                <input
                  type="text"
                  placeholder="Enter location"
                  className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 focus:border-transparent"
                  value={searchParams.location}
                  onChange={(e) =>
                    handleInputChange("location", e.target.value)
                  }
                />
              </div>
              <div className="col-span-3">
                <select
                  className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 focus:border-transparent"
                  value={searchParams.orgType}
                  onChange={(e) => handleInputChange("orgType", e.target.value)}
                >
                  <option value="">Select type</option>
                  <option value="nonprofit">Nonprofit</option>
                  <option value="forprofit">For-profit</option>
                  <option value="social">Social Enterprise</option>
                </select>
              </div>
              <div className="col-span-4">
                <input
                  type="text"
                  placeholder="What kind of organization are you looking for?"
                  className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 focus:border-transparent"
                  value={searchParams.goal}
                  onChange={(e) => handleInputChange("goal", e.target.value)}
                />
              </div>
              <div className="col-span-2">
                <button
                  onClick={handleSearch}
                  className="w-full px-6 py-2 bg-teal-600 text-white rounded-lg hover:bg-teal-700 transition-colors duration-200"
                >
                  Search
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Partnership;
